import {StyleSheet, Text, View, TouchableOpacity, Image} from "react-native";
import {LinearGradient} from "expo-linear-gradient";

export default function App() {
  return (
    <View style={styles.container}>
        {/* <LinearGradient colors={["#904e95", "#e96443"]} style={styles.linearGradient} start={[0.2,0]} end = {[0,1]} /> */}
        <Image style={styles.linearGradient} source={require("./assets/backgroundGradient.png")} />
        <View style={styles.titleContainer}>
          <Text style={styles.titleText}>Beginners?</Text>
          <Text style={styles.defaultText}>See what we can do for you.</Text>
        </View>
        <View style={styles.buttonBox}>
          <View style={styles.OKButton}>
              <TouchableOpacity>
                <Text style={styles.text}>OK</Text>
              </TouchableOpacity>
          </View>
          <View style={styles.dismissButton}>
              <TouchableOpacity>
                <Text style={styles.text}>OK</Text>
              </TouchableOpacity>
          </View>
        </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    fontFamily: "sf compact text",
  },

  titleContainer: {
    paddingLeft: "30px",
    paddingTop: "75px"

  },

  titleText: {
    color: "#fff",
    fontSize: "50px",
    fontWeight: "700",
    letterSpacing: "1px",
  },

  text: {
    color: "#fff",
    fontSize: "17px",
    marginTop: "2px"
  },

  buttonBox: {
    width: "100%",
    alignItems: "center",
    position: 'absolute',
    bottom: "150px",
  },

  button: {
    width: "250px",
    height: "50px",
    borderRadius: "7px",
    backgroundColor: "#0263FF",
    color: "white",
    alignItems: "center",
    justifyContent: "center"
  },

  linearGradient: {
    zIndex: -1,
    position: "absolute",
    left: 0,
    right: 0,
    top: 0,
    height: "100%"
  }
});
